$font: 'Rosarivo', serif;
$desktop: 700px;
$green-color: #757e61;
$orange-color: #e4c396;
$brown-color: #b46f36;
$dark-color: #3d3f3e;

* {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
}

body {
    width: 100%;
    min-height: 100vh;
    font-family: $font;
    background-color: #000;
    overflow-x: hidden;
}

.background {
    background-image: url("mobile.jpg");
    background-repeat: no-repeat;
    background-size: cover;
    background-attachment: fixed;
    @media (min-width: $desktop) {
        background-image: url("desktop.jpg");
    }
}

nav {
    font-size: 1em;
    position: sticky;
    top: 0;
    left: 0;
    z-index: 44;
    background: rgba(0,0,0,0.1);
    ul {
       display: flex;
       justify-content: space-between;
       padding: 0.5em 1em;
       list-style: none;
       @media (min-width: $desktop) {
            padding: 0.4em 1em;
        }
        li:first-child a{
            color: $dark-color;
            @media (orientation: portrait) {
                color: $orange-color;
            }
        }
       a {
           text-decoration: none;
           color: $orange-color;
            @media (orientation: portrait) {
                color: $dark-color;
            }
            &:hover {
              font-weight: bold;
            }
        }
    }
}

header {
    min-height: 100vh;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    text-align: center;
    color: #fff;
    background-color: rgba(0, 0, 0, 0.1);
    // svg girl
    .bzinka {
        display: inline-block;
        position: absolute; 
        top: 40%;
        right: 8%;
        @media (orientation: portrait) {
            top: 30%;
            right: 0%;
        }
        svg {
            width: 30%;
            height: auto;
            @media (orientation: portrait) {
                width: 45%;
            }
        }
    }
    h1 {
        font-size: 2rem;
        margin-bottom: 1rem;
        color: $dark-color;
        text-shadow: 2px 2px 1px #fff;
        cursor: pointer;
        @media (min-width: $desktop) {
            font-size: 3rem;
        }
        @media (orientation: portrait) {
            // margin-top: -2rem;
        }
    }
    h2 {
        font-size: 1.2rem;
        text-shadow: 1px 1px 2px $dark-color;
        cursor: pointer;
        @media (min-width: $desktop) {
            font-size: 1.5rem;
        }
    }
}

.about {
    background-color: rgba(0, 0, 0, 0.1);
    padding: 0 2em;
    width: 60vw;
    margin: 0 auto;
    color: #fff;
    width: 100%;
    color: $dark-color;
    @media (min-width: $desktop) {
        padding: 0 6em;
    }
    &-header{
        min-height: 90vh;
        display: flex;
        flex-direction: column;
        justify-content: center;
        span a{
            color: $brown-color;
            font-weight: bold;
            cursor: pointer;
            text-decoration: none;
        }
    }
    h2 {
        font-size: 2rem;
        margin-bottom: 3rem;
        text-align: center;
        letter-spacing: 0.2em;
        @media (min-width: $desktop) {
            font-size: 3rem;
        }
    }
    p {
        text-align: center;
        line-height: 2em;
        margin-bottom: 1em;
        font-size: 0.9em;
        @media (min-width: $desktop) {
            line-height: 2em;
            font-size: 1em;
        }
    }
}

// social media
.contact {
    width: 100%;
    margin: 0 auto;
    display: flex;
    justify-content: space-between;
    padding: 3em 1.2em;
    align-items: center;
    @media (min-width: $desktop) {
        width: 50%;
        padding: 4em 1.2em;
        justify-content: space-evenly;
    }
    i {
        font-size: 1.3em;
        color: #fff;
        transition: all 0.4s linear;
        color: $dark-color;
        &:hover {
           color:$orange-color;
        }
    }
    a:nth-child(1) i {
        color: $orange-color;
        &:hover {
            color:$green-color;
         }
    }
    a:nth-child(3) i {
        color: $green-color;
        &:hover {
            color:$brown-color;
         }
    }
    a:nth-child(4) i {
        color: $brown-color;
        &:hover {
            color:$dark-color;
         }
    }
}

// portfolio page
.portfolio {
    background-color: rgba(0, 0, 0, 0.1);
    min-height: 100vh;
    display: flex;
    justify-content: space-evenly;
    align-items: center;
    position: relative;
    .svg-bird {
        border: 2px solid red;
        width : 10%;
        position: absolute;
        top: -2%;
        left: 50%;
    }
    &-box {
        @media (orientation: portrait) {
            width: 85%;
            height: 90vh;
        }
        @media (min-width: $desktop) {
            width: 60%;
            height: 70vh;
        }
        @media (min-width: 600px) and (max-width: 1100px) and (orientation: landscape) {
            width: 80%;
            height: 85vh;
        } 
        background-color: rgba(255, 255, 255, 0.5);
        display: flex;
        flex-direction: column;
        justify-content: space-evenly;
        align-items: center;
        border-radius: 50px;
        &-content {
            overflow: hidden;
            border-radius: 20px 20px 0 0;
            background-color: #000;
            @media (orientation: portrait) {
                width: 85%;
                height: 75vh;
            }
            @media (min-width: $desktop) {
                width: 90%;
                height: 80%;
                // padding: 2em;
            }
            color: $orange-color;
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
            position: relative;
            @media (min-width: 600px) and (max-width: 1100px) and (orientation: landscape) {
                width: 85%;
                height: 70vh;
                justify-content: space-between;
            } 
            .video-mobile {
                @media (min-width: $desktop) {
                   display: none;
                }
                @media (orientation: portrait) {
                   display: block;
                }
                @media (min-width: 600px) and (max-width: 1100px) and (orientation: landscape) {
                    display: none;
                } 
            }
            .video-desktop {
                @media (orientation: portrait) {
                    display: none;
                 }
            }
            video {
                width: 100%;
                height: 100%;
                // margin: 0.8em auto;
            } 
            .img-mobile {
                @media (min-width: $desktop) {
                   display: none;
                }
                @media (orientation: portrait) {
                   display: block;
                }
                @media (min-width: 600px) and (max-width: 1100px) and (orientation: landscape) {
                    display: none;
                } 
            }
